const noCors = 'https://floating-beyond-79262.herokuapp.com/'

const fetchGetClients = () => {
  const result = fetch(`${noCors}https://gentle-inlet-87565.herokuapp.com/clients`)
    .then((response) => response.json())
    .then((result) => console.log(result))
}

export {
  fetchGetClients,
}
